import React, { PureComponent } from 'react';
import style from "./right.module.css";
import EmergencyTable from "./EmergencyTable.js"
import EmergencyManage from "./EmergencyManage.js"

export default class EmergencyCommandChartRight extends PureComponent {
    render() {
        return (
            <div className={style.toRight}>
				<EmergencyManage></EmergencyManage>
				
            </div>
        );
    }
}
